import React from 'react';
import Header from '../components/Header';
import { useAuth } from '../auth/AuthProvider';

function Home() {
	const { onLogin } = useAuth();

	return (
		<div>
			<Header />
			<h2>This is the home page.(Public)</h2>
			<button className='btn' onClick={onLogin}>
				Sign In
			</button>
		</div>
	);
}

export default Home;
